import img1 from '../img/img1.png';
import img2 from '../img/img2.png';
import img3 from '../img/img3.png';
import img4 from '../img/img4.png';

export const Followers = [
    { name: "Nileesha Bojjawar", username: "NileeshaB", img: img1},
    { name: "Vijay Kumar", username: "VijayKumar", img: img2},
    { name: "Lydia Mattikoyya", username: "LydiaMattikoyya", img: img3},
    { name: "Ashish Banda", username: "ABANDA", img: img4},
];
